import Typography from '@mui/material/Typography';
import Paper from "@mui/material/Paper"
import Grid from "@mui/material/Grid"
import Container from "@mui/material/Container"
import Box from "@mui/material/Box"
import { MainCardsDiv } from "../mui_css/styledComponents"

const classMainPanelDiv = {
  divMainPannel: {
    flexGrow: 1,
	margin: 20,
  },
  paper: {
    padding: 20,
	margin:10,
    textAlign: "center",
    backgroundColor: "#fafafa",
    color: "white",
	width: '330px',
	height: '200px',
  },
  box:{
	margin: 20,
	backgroundColor: "#fafafa",
    color: "gray",
	width: '400px',
	height: '300px',
  }
};

const MainPannel = () =>{
    return(
	<div style={classMainPanelDiv.divMainPannel}>
        <Container maxWidth="xl">
			<Grid container spacing={2} justifyContent="center">				
				{fGenBox()}
			</Grid>			
        </Container>
	</div>
    )
}

function fGenBox(){
	let res = [];
	for(var i=0; i < 3; i++){
		res.push(
			<Box style={classMainDiv.box}>			
					<Paper style={classMainDiv.paper}>item</Paper>
					<Typography variant="h5" textAlign="center"  >
						Title
					</Typography>				
			</Box>
		)
	}
	return(res)	
}


export default MainPannel;
